avegador está habilitado','Browser caching is disabled'=>'Caché del navegador está desactivado','Enabling browser caching can improve performance by storing static assets in the browser for faster page loads.'=>'Activar la caché del navegador puede mejorar el rendimiento al almacenar activos estáticos en el navegador para una carga de páginas más rápida.','Cloudflare enabled'=>'Cloudflare activado','Cloudflare integration is enabled'=>'La integración con Cloudflare está habilitada','Cloudflare integration is disabled'=>'La integración con Cloudflare está desactivada','Cloudflare integration can improve performance and security.'=>'La integración con Cloudflare puede mejorar el rendimiento y la seguridad.','Concatenate CSS'=>'Concatenate CSS','CSS files are concatenated'=>'Los archivos CSS están concatenados','CSS files are not concatenated'=>'Los archivos CSS no están concatenados','Concatenating CSS can improve performance by reducing the number of requests.'=>'Concatenar CSS puede mejorar el rendimiento reduciendo el número de solicitudes.','Concatenate JavaScript'=>'Concatenar JavaScript','JavaScript files are concatenated'=>'Los archivos JavaScript están concatenados','JavaScript files are not concatenated'=>'Los archivos JavaScript no están concatenados','Concatenating JavaScript can improve performance by reducing the number of requests.'=>'Concatenar JavaScript puede mejorar el rendimiento reduciendo el número de solicitudes.','WP Cron Lock Timeout'=>'Tiempo de bloqueo Cron WP agotado','Cron lock timeout is set to 60 seconds or less.'=>'El tiempo de espera del reloj se establece en 60 segundos o menos.','Cron lock timeout is set to a high number.'=>'El tiempo de espera del reloj Cron se establece en un número alto.','Cron lock timeout affects how long a cron job can run for. Setting it to a lower number can improve performance.'=>'El tiempo de espera del reloj afecta a cuánto tiempo puede funcionar un trabajo de cron. Establecerlo a un número más bajo puede mejorar el rendimiento.','Defer Non-Essential JavaScript'=>'Aplazar JavaScript no esencial','Non-essential JavaScript is deferred'=>'JavaScript no esencial se aplaza','Non-essential JavaScript is not deferred'=>'JavaScript no esencial no se aplaza','JavaScript can be deferred to improve performance by loading it after the page has loaded.'=>'JavaScript puede ser diferido para mejorar el rendimiento cargándolo después de que la página haya cargado.','Empty Trash Days'=>'Vaciar días de papelera','Trash is emptied every 30 days or less'=>'La papelera está vacía cada 30 días o menos','Trash is emptied less frequently than every 30 days.'=>'La basura se vacía con menos frecuencia que cada 30 días.','Emptying the trash more frequently can reduce database bloat.'=>'Vaciar la papelera con más frecuencia puede reducir la carga de la base de datos.','Lazy Loading'=>'Carga perezosa','Lazy loading is enabled'=>'La carga perezosa está habilitada','Lazy loading is disabled'=>'La carga perezosa está desactivada','Lazy loading can improve performance by only loading images when they are in view.'=>'La carga perezosa puede mejorar el rendimiento cargando sólo imágenes cuando están en visión.','Link Prefetching'=>'Prefetching de enlace','Link prefetching is enabled'=>'Enlace prefetching está habilitado','Link prefetching is disabled'=>'Enlace prefetching está desactivado','Link prefetching can improve performance by loading pages immediately before they are requested.'=>'La prebúsqueda de enlaces puede mejorar el rendimiento cargando las páginas inmediatamente antes de que se soliciten.','Page Caching'=>'Caché de páginas','Page caching is enabled'=>'Caché de páginas está habilitado','Page caching is disabled'=>'Caché de páginas está desactivado','Page caching can improve performance by bypassing PHP and database queries for faster page loads.'=>'El almacenamiento en caché de páginas puede mejorar el rendimiento pasando por alto PHP y consultas de bases de datos para una carga de págin