uración de caché guardada','Clear All Cache Now'=>'Borrar toda la caché ahora','We automatically clear your cache as you work (creating content, changing settings, installing plugins and more). But you can manually clear it here to be confident it is fresh.'=>'Limpiamos automáticamente tu caché a medida que trabajas (creando contenido, cambiando configuración, instalando plugins y más). Pero usted puede limpiar manualmente aquí para estar seguro de que está fresco.','Cache cleared'=>'Caché borrada','Clear Cache'=>'Limpiar caché','Exclude from cache'=>'Excluir del caché','This setting controls what pages pass a “no-cache” header so that page caching and browser caching is not used.'=>'Esta configuración controla qué páginas pasan un encabezado “no-cache” para que no se utilice la caché de páginas y la caché del navegador.','Cache Exclusion saved'=>'Exclusión de caché guardada','Save'=>'Guardar','Skip 404'=>'Saltar 404','When enabled, static resources like images and fonts will use a default server 404 page and not WordPress 404 pages. Pages and posts will continue using WordPress for 404 pages. This can considerably speed up your website if a static resource like an image or font is missing.'=>'Cuando está habilitado, recursos estáticos como imágenes y fuentes usarán un servidor predeterminado 404 página y no WordPress 404 páginas. Páginas y entradas continuarán utilizando WordPress para 404 páginas. Esto puede acelerar considerablemente su sitio web si falta un recurso estático como una imagen o fuente.','Enable Skip 404 Handling For Static Files'=>'Habilitar omitir manejo 404 para archivos estáticos','Skip 404 saved'=>'Saltar 404 guardado','Image Optimization'=>'Optimización de imagen','We automatically optimize your uploaded images to WebP format for faster performance and reduced file sizes. You can also choose to delete the original images to save storage space.'=>'Optimizamos automáticamente sus imágenes subidas al formato WebP para un rendimiento más rápido y 