 el descenso del ratón: Comienza a cargar la página tan pronto como haga clic en el botón abajo, para una respuesta más rápida cuando suelte el clic.','Prefetch on Mouse Hover (Recommended)'=>'Prefetch en Mouse Hover (Recomendado)','Prefetch on Mouse Hover: Begins loading the page the moment your cursor hovers over a link'=>'Prefetch en el pasar del ratón: Empieza a cargar la página en el momento en que el cursor pasa por encima de un enlace','Enable link prefetching on mobile'=>'Habilitar prebúsqueda de enlaces en el móvil','Activate on mobile'=>'Activar en el móvil','Prefetch on Touchstart (Recommended)'=>'Prefetch en Touchstart (Recomendado)','Prefetch on Touchstart: Instantly starts loading the page as soon as you tap the screen, ensuring a quicker response when you lift your finger.'=>'Prefetch en Touchstart: Al instante comienza a cargar la página tan pronto como toque la pantalla, garantizando una respuesta más rápida cuando levante el dedo.','Prefetch Above the Fold'=>'Prefetch encima del pliegue','Prefetch Above the Fold: Loads links in your current view instantly, ensuring they\'re ready when you need them.'=>'Prefetch Above the Fold: Carga enlaces en tu vista actual al instante, asegurándote de que estén listos cuando los necesites.','Exclude Keywords: A comma separated list of words or strings that will exclude a link from being prefetched. For example, excluding "app" will prevent https://example.com/apple from being prefetched.'=>'Excluir palabras clave: Una lista separada por comas de palabras o cadenas que excluirán un enlace de ser predescargado. Por ejemplo, excluir "app" evitará que https://example.com/apple sea preinstalado.','Exclude keywords'=>'Excluir palabras clave','Advanced settings'=>'Ajustes avanzados','Additional speed and scalability features powered by Jetpack Boost to make your site as fast as it can be.'=>'Funciones adicionales de velocidad y escalabilidad alimentadas por Jetpack Boost para hacer su sitio lo más rápido posible.','Optimize Critical CSS Loading (manual)'=>'Optimizar Carga Crítica CSS (manual)','Move important styling information to the start of the page, which helps pages display your content sooner, so your users don’t have to wait for the entire page to load.'=>'Mover información de estilo importante al inicio de la página, que ayuda a las páginas a mostrar su contenido antes, para que tus usuarios no tengan que esperar a que toda la página se cargue.','Optimize Critical CSS Loading (UPGRADED)'=>'Optimizar Carga Crítica CSS (UPGRADED)','Generate Critical CSS Automatically'=>'Generar CSS Crítico automáticamente','Move important styling information to the start of the page, which helps pages display your content sooner, so your users don’t have to wait for the entire page to load.%1$s %2$sBoost will automatically generate your Critical CSS%3$s whenever you make changes to the HTML or CSS structure of your site.'=>'Mover información de estilo importante al inicio de la página, que ayuda a las páginas a mostrar su contenido antes, para que tus usuarios no tengan que esperar a que toda la página se cargue.%1$s %2$sBoost generará automáticamente su CSS crítico%3$s cada vez que haga cambios en la estructura HTML o CSS de su sitio.','Run non-essential JavaScript after the page has loaded so that styles and images can load more quickly.'=>'Ejecute JavaScript no esencial después de que la página haya cargado para que los estilos e imágenes puedan cargar más rápidamente.','Concatenate JS'=>'Concatenar JS','Scripts are grouped by their original placement, concatenated and minified to reduce site loading time and reduce the number of requests.'=>'Los scripts se agrupan por su colocación original, concatenados y minimizados para reducir el tiempo de carga del sitio y reducir el número de solicitudes.','Exclude JS Strings'=>'Excluir cadenas JS','Styles are grouped by their original placement, concatenated and minified to reduce site loading time and reduce the number of requests.'=>'Los estilos se agrupan por su colocación original, concatenados y minimizados para reducir el tiempo de carga del sitio y reducir el número de solicitudes.','Exclude CSS Strings'=>'Excluir cadenas CSS','Show more'=>'Mostrar más','Show less'=>'Mostrar menos','Discover More'=>'Descubre más','Install Jetpack Boost to unlock'=>'Instalar Jetpack Boost para desbloquear','Installing Jetpack Boost…'=>'Installing Jetpack Boost…','Jetpack Boost is now active'=>'Jetpack Boost está activo','Activation failed'=>'Activación fallida','Discover more %1$shere%2$s'=>'Descubre más %1$saquí%2$s','Option saved correctly'=>'Opción guardada correctamente','Error saving option'=>'Error al guardar la opción','Upgrade to unlock'=>'Actualiza para desbloquear']];